import * as React from 'react';
import { Box, Typography } from '@mui/material';

const Blog = () => {
    return (
        <Box sx={{ height: '100vh', backgroundColor: '#EEEEEE', padding: '5%' }}>
            <Typography variant="h4" sx={{ fontWeight: 'bold', color: '#333' }}>
                Sunday Blogs
            </Typography>
        </Box>
    );
}

export default Blog;
